import React, { useState } from 'react'

const ColorFlipper = () => {
    const [r, setr] = useState(0)
    const [g, setg] = useState(0)
    const [b, setb] = useState(0)
    function changeVal(){
        r=Math.random
    }
    return (
        <div>
            <h2>-> R :{r} </h2>
            <h2>-> G :{g} </h2>
            <h2>-> B :{b} </h2>
            <button onClick={changeVal}></button>
        </div>
    )
}

export default ColorFlipper
